from collections import Counter
import re

def t_f_positives(positives, k=5):
    """
    Checks if positively identified stretch has k consecutive identical bases.
    
    Returns: true positive, false positive
    """    
    homopolymer_A = re.compile("([A]{" + str(k) + "})")
    homopolymer_C = re.compile("([C]{" + str(k) + "})")
    homopolymer_G = re.compile("([G]{" + str(k) + "})")
    homopolymer_T = re.compile("([T]{" + str(k) + "})")
    
    true = {}
    false = {}
    
    for kmer in positives.keys():
        if len(kmer) >= k:
            if homopolymer_A.match(kmer) or homopolymer_C.match(kmer) or homopolymer_G.match(kmer) or homopolymer_T.match(kmer)!= None:
                true[kmer] = positives[kmer]   
            else:
                false[kmer] = positives[kmer]
        else:
            false[kmer] = positives[kmer]
    print("TPs: ", sum([true[t] for t in true]))
    print("FPs: ", sum([false[f] for f in false]))
    
    #~ print(true)
    return true, false
    


